(1, 'The Tech Weekend-2023', '2023-06-07', '10:00:00', ' Faculdade de Ciências Exatas e Tecnologia da PUC-SP', '30', 'The Tech Weekend é um evento sem fins lucrativos com o propósito de popularizar temas antes somente abordados em grandes convenções onde os valores fogem da realidade da maioria das pessoas interessadas por tecnologia e inovação.\r\nA equipe organizadora está trabalhando para um #GiveBack para a comunidade, para que os participantes possam ter acesso a especialistas acadêmicos e profissionais de mercado e se atualizem das tendências e novas tecnologias que estão se espalhando pelo mundo EM APENAS 1 FIM DE SEMANA.\r\nO público pode aprimorar seu repertório tecnológico (técnico, em negócios e em inovação) de forma intensiva e imersiva em computação, engenharias e ciências naturais. São mais de 30 horas de programação ininterrupta.', ),
(2, 'Encontro Anual de Tecnologia de 2023', '2023-08-01', '10:00:00', 'Centro de Conferências, Av. Bernardino de Campos, 98 ', '100', 'Que a tecnologia é indispensável para as empresas crescerem hoje, todos sabemos. O grande desafio está em nos tornarmos profissionais estratégicos, capazes de usar a tecnologia para atingir os objetivos de negócio das nossas áreas e empresas. No Universo TOTVS 2023, teremos trilhas de conteúdos pensadas para apoiar você nessa jornada. Vem com a gente!', ),
(3, 'FEBRABAN TECH 2023', '2023-06-27', '09:00:00', 'Transamerica Expo Center - São Paulo  Avenida Doutor ', '540', 'A 33ª edição do maior evento de tecnologia e inovação do setor financeiro na América Latina reúne lideranças dos setores financeiro, tecnologia e de áreas interessadas em inovação, para debates sobre temas atuais da economia digital.\r\nNeste ano, o evento terá 11 trilhas temáticas\r\nCom tema central “A bioeconomia e as oportunidades em uma sociedade digital”, o evento reúne as lideranças dos setores financeiro, tecnologia, sustentabilidade e de áreas interessadas em inovação, para debates sobre te', );
