(5, 'Campus Party 2023', '2023-07-25', '09:00:00', 'Distrito do Anhembi na Avenida Olavo Fontoura, 1209 –', '420', 'A Campus Party é o maior festival de tecnologia, empreendedorismo, ciência e disruptividade do mundo, com mais de 70 edições realizadas em 30 países. \r\nUm ambiente imersivo de disrupção, educação e criatividade, onde nossas comunidades são parte essencial da experiência, mobilizando a transformação.', );
