(6, 'Futurecom 23', '2023-10-03', '08:00:00', 'São Paulo - SP', '500', 'O Futurecom é a maior plataforma B2B de conteúdo e relacionamento voltada ao universo de conectividade da América Latina. Há 23 anos fomentando o mercado, combina exposição, experiências, debates, networking e demonstrações sobre os impactos das aplicações de tecnologias em praticamente todos os segmentos da economia, gerando grandes oportunidades de negócios.', );

